Experiências profissionais:


Desde 2009, tenho familiaridade com a Economia de Abundância, Agricultura Sintrópica e Agroflorestas, que tive oportunidade de aprender durante um curso com Ernst Götsch em 2010. Também tenho experiência com Manejo de Impacto Reduzido na Amazônia, aprendido durante a Expedição Brasil Norte-Sul 2012 e em curso ministrado na Floresta Estadual do Antimary/FUNTAC.

?Em 2 anos de consultoria florestal, ofereci soluções de redação técnica sintética e clara em licenciamentos ambientais, levantamentos de Impacto Ambiental, Socioeconômicos, Inventário/Manejo Florestal e de Fauna, Mercado Florestal e Recuperação de Áreas Degradadas. Criei e organizei bancos de dados claros e intuitivos que otimizaram o trabalho dos meus supervisores. Colaborei na análise de dados e simulação matemática de modelos de estimativas florestais e outras.

Fui coordenadora de Comunicação em campanha eleitoral vitoriosa, e consultora de projetos de desenvolvimento turístico. Trabalho com Recuperação de Áreas Degradadas (PRAD), Agenda 2030 ONU/ Igualdade de Gênero, regularização de imóveis rurais (CAR), Mercado Florestal, Sustentabilidade, Planejamento, Comunicação e Marketing, Inventário e Manejo Florestal.

?Também tenho familiaridade com Filosofia Budista e práticas de meditação, as quais busco incluir nas minhas atividades diárias e no esforço de me tornar um ser humano melhor :)
Hobbies:

Gosto MUITO de ler, especialmente jornais, filosofia, literatura (Edgar Allan Poe, Virginia Woolf, John Steinbeck, Erich Fromm e Dostoievski, por exemplo). Também gosto de artes em geral (aprendi o básico de design gráfico por gosto). Viajo constantemente pelo Brasil, particularmente para o meio rural e florestal, e tenho planos de conhecer o máximo de florestas no mundo que eu conseguir enquanto viver!

Pratico Yoga regularmente e também medito. Sigo estudando filosofia budista e aprofundando nas práticas.

Sou bastante curiosa. No meu tempo livre costumo assistir documentários no NetFlix. E desenho animado também.
Agronegócio:

Sou Engenheira Florestal de formação, e plantios florestais (de eucalipto, pinus, etc) são considerados uma forma de Agronegócio. Além disso, a profissão me aproxima de diversas frentes do meio rural brasileiro, me oferecendo a possibilidade de uma visão ampla sobre o tema. Por exemplo, existem oportunidades de negócios no meio agro tanto para pequenos produtores quanto para os grandes.

Leio constantemente sobre o tema em jornais específicos como Canal Rural, Portal Florestal, Canal do Boi, entre outros. Produzo conteúdo sobre o tema no meu site pessoal também.
Engenharia:

Antes de me formar Engenheira Florestal, cursei por 2 anos Engenharia Ambiental na Universidade Federal do Paraná. Este curso enfatizava muito o aspecto técnico e matemático da Engenharia. Fiz as matérias de Cálculo I ao IV, Álgebra Linear, Termodinâmica, Métodos Numéricos e Programação de Computadores, por exemplo. Esse conhecimento me conferiu facilidade em compreender aspectos técnicos das engenharias e comunicá-las em redações técnicas de excelente qualidade.

Na Engenharia Florestal, aproximei-me da Estatística, Dendrometria e Inventário Florestal, por ter mais afinidade com a área matemática. Fiz estágios nas áreas de Dendrocronologia e Biomassa Florestal. Também estagiei em Política Florestal, tema em que sigo atuando.
Meio Ambiente:

Trabalho também como Consultora Ambiental nas áreas de Recuperação de Áreas Degradadas, Licenciamento Ambiental, Manejo Florestal, Projetos Florestais, Regularização Fundiária, Sustentabilidade, Inventário Florestal e Recursos Hídricos. Ofereço consultoria nas demais áreas associadas à Engenharia Florestal, bem como Agricultura Sintrópica (Agroflorestas), Igualdade de Gênero e Sustentabilidade e Economia Ambiental.
